import "./ExpenseItem.css";

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div className="date">30/04/1999</div>
      <div className="expense-name">Watched Movie</div>
      <div className="expense-ammount">200/-</div>
    </div>
  );
}

export default ExpenseItem;
